import React from "react";
import Exercise1 from "./Ex/Exercise1";
import Exercise2 from "./Ex/Exercise2";
import Exercise3 from "./Ex/Exercise3";
import Exercise4 from "./Ex/Exercise4";
import Exercise5 from "./Ex/Exercise5";
import Exercise6 from "./Ex/Exercise6";
import Exercise7 from "./Ex/Exercise7";
import Exercise8 from "./Ex/Exercise8";
import Exercise9 from "./Ex/Exercise9";
import Exercise10 from "./Ex/Exercise10";

function App() {
  return (
    <div style={{ padding: "20px", fontFamily: "Arial" }}>
      <Exercise1 />
      <Exercise2 />
      <Exercise3 />
      <Exercise4 />
      <Exercise5 />
      <Exercise6 />
      <Exercise7 />
      <Exercise8 />
      <Exercise9 />
      <Exercise10 />
    </div>
  );
}

export default App;
